const TextWrap = styled.div`
  width: 100%;
  max-width: 55%;
  height: 100%;
  margin: 200px auto;
  color: ${({ theme }) => theme.colors.black_color};
`;
const Txt = styled.div`
  width: 100%;
  color: ${({ theme }) => theme.colors.black_color};

  h3 {
    text-align: center;
    font-weight: 600;
    font-size: 2rem;
    padding-top: 50px;

    color: ${({ theme }) => theme.colors.main_color};
    &::after {
      content: "";
      display: block;
      width: 100%;
      height: 1px;
      background: ${({ theme }) => theme.colors.main_color};
      margin: 30px auto;
    }
    @media ${({ theme }) => theme.device.laptop} {
      width: 100%;
    }
    @media ${({ theme }) => theme.device.tablet} {
      width: 100%;
      font-size: 1.5rem;

      padding-top: 30px;
    }
  }
`;

const ContentWrap = styled.div`
  position: relative;
  display: flex;
  justify-content: flex-start;
  width: 100%;
  line-height: 160%;
  color: ${({ theme }) => theme.colors.black_color};
  h4 {
    width: 40%;
    font-size: 1rem;
    color: ${({ theme }) => theme.colors.black_color};
    @media ${({ theme }) => theme.device.mobile} {
      width: 100%;
      font-size: 0.8rem;
    }
  }
`;

